import React from "react";

function Header() {
    return (
        <div className="jumbotron text-center">
            <div className="container text-dark">
                <h1 style={{ height: 300, clear: "both", paddingTop: 120, textAlign: "center" }}>
                    Google Books Search</h1>
            </div>
        </div>
    );
}

export default Header;
